import React from 'react';
import { observer } from 'mobx-react';

class MobileHome extends React.Component {

  render() {
    const { store } = this.props
    const { users } = store
    return (
      <div>
        {
          users.map((user) => (
            <div>Hello</div>
          ))
        }
      </div>
    );
  }
}

export default observer(MobileHome);
